import "./trip_style.css";
import image1 from "../asserts/card1.jpg";
import image2 from "../asserts/card2.jpg";
import image3 from "../asserts/card3.jpg";

export default function Trip(prop){
    return(
        <div className="trip">
            <h1>Live your Honeymoon as a Famous Star</h1>
            <p></p>
            <div className="trip-card">
            {prop.title.map((item, index)=>{
                return
            })}
                <TripData
                    src={image1} 
                    heading="Barcellona"
                    text="Stroll down La Rambla, the heartbeat of the city, hand in hand, as street performers serenade your love story. Explore the whimsical architecture of GaudÃ­, where each curve and color tell a tale of artistic devotion. Dine under the stars at a charming Catalan bistro, savoring the flavors of a city that dances on the taste buds."
                />
                <TripData
                    src={image2} 
                    heading="Dolomites Mountains"
                    text="Wander hand in hand through alpine meadows adorned with wildflowers, the air crisp with the promise of adventure. As daylight fades, cozy up in a mountain chalet, the warmth of a crackling fire mirroring the glow in your hearts. "
                />
                <TripData
                    src={image3} 
                    heading="Venice"
                    text=" A dreamy honeymoon in Venice, where the ancient city becomes a canvas for love. Glide along the quiet canals in a gondola, the serenade of the gondolier echoing your heart's melody. Lose yourselves in the narrow, winding streets, stumbling upon hidden gems and cozy cafes."
                />
            </div>

        </div>
    );
}
